import React from 'react';
import { Inviter, SessionState, UserAgent, Registerer } from "sip.js";

function Phone(props) {


    const onInvite = (invitation) => {
        invitation.accept();
    }

    const transportOptions = {
        server: "wss://webrtc2.odricall.com:8443"
    };

    const uri = UserAgent.makeURI("sip:6666@odricomt2.odricall.com");

    const userAgentOptions = {
        authorizationPassword: '#rCVGePfdwn%%',
        authorizationUsername: '6666',
        transportOptions,
        delegate: {
            onInvite
        },
        uri
    };


    const userAgent = new UserAgent(userAgentOptions);

    const registerer = new Registerer(userAgent);

    userAgent.start().then(() => {
        registerer.register();
    });

    // userAgent.start().then(() => {
    //     const target = UserAgent.makeURI("sip:0534217014@odricomt2.odricall.com");

    //     const inviter = new Inviter(userAgent, target);
    //     inviter.invite();
    // });


    return (
        <div>

        </div>
    );
}

export default Phone;
